description:
Efter flera raider mot civila handelsfartyg, Blir det tyska &quot;fickslagskeppet&quot;
Admiral Graaf Spee instangd av tre brittiska slagskepp i Montvideos hamn. 
Dar hon sokt skydd efter skador hon fatt i ett slag med dem. Men de vantar 
ute pa internationellt vatten, och efter nagra dagar tvingas Graf Spee ut till 
sjoss igen efterson Uraguay var neutralt. Ut for att mota en overlagsen 
styrka... eller....
